import React from "react";
import { Field } from "formik";
import Select from "./Select";

function TextInput(props) {
  return (
    <div>
      <Field
        items={props.items}
        name={props.name}
        as={Select}
        label={props.label}
        required={props.required}
      ></Field>
    </div>
  );
}

export default TextInput;
